import React from 'react'
import "./Nav.css"
function Nav() {
    return (
        <div className="nav">
            <img src="https://www.gamespot.com/a/uploads/original/1578/15789366/3515380-3404880-1367679707-31jfj.png" alt="" />
            <h1>Hi</h1>
        </div>
    )
}

export default Nav
